    private static readonly Random Rng = new Random();

    [HideInInspector] public int selectedLang;
    [SerializeField] private TMP_Dropdown langDropdown;

    private void Start()
    {
        InitLayoutManager();
    }

    public string SelectWord()
    {
        int wordIndex;
        string selectedWord;

        switch (selectedLang)
        {
            case (int)LangNamespace.Language.English:
                wordIndex = Rng.Next(_englishWords.Count);
                selectedWord = _englishWords[wordIndex];
                _englishWords.Remove(_englishWords[wordIndex]);
                break;
            default:
                wordIndex = Rng.Next(_turkishWords.Count);
                selectedWord = _turkishWords[wordIndex];
                _turkishWords.Remove(_turkishWords[wordIndex]);
                break;
        }

        return selectedWord;
    }

    //Set Language from GameManager
    private void InitLayoutManager()
    {
        selectedLang = GameManager.Instance.language;
        langDropdown.GetComponent<TMP_Dropdown>().value = selectedLang;
    }

    //Lang Dropdown Button on click func from mainmenu sceene
    public void UpdateSelectedLangButton()
    {
        var dropdown = langDropdown.GetComponent<TMP_Dropdown>();
        selectedLang = dropdown.value;
        SetChangeLang();
    }

    private void SetChangeLang()
    {
        GameManager.Instance.language = selectedLang;
        GameManager.Instance.SetLevelData();
    }
}